class DefaultDataCreator extends Component {

	constructor () {
		super();
		this.state = {
			loading: false,
			loaded: false,
			finished: false,
			singleProfiles: null,
			friends: null
		};

		this.loadData = this.loadData.bind(this);
		this.createRelations = this.createRelations.bind(this);
	}

	componentWillReceiveProps(nextProps) {
		if (this.state.finished && !nextProps.profiles.fetched && !nextProps.profiles.fetching && !nextProps.profiles.error) {
			store.dispatch(ProfileActionCreator.getAll('single'));
		} else if (!this.state.singleProfiles && nextProps.profiles.fetched) {
			this.setState({
				singleProfiles: nextProps.profiles.data
			});
			store.dispatch(ProfileActionCreator.getAll('friend'));
		} else if (!this.state.friends && nextProps.profiles.fetched) {
			this.setState({
				friends: nextProps.profiles.data
			});
		}
	}

	render() {

		if (!this.state.loading && !this.state.loaded) {
			return (<div>
				<h1>Data importer</h1>
				<button onClick={this.loadData}>Load data</button>
			</div>);
		}
		return (<div>
			<h1>Data importer</h1>
			<h4>Data successfully imported</h4>
			<button onClick={this.createRelations}>Create Relations</button>
		</div>);
	}

	loadData() {

		this.setState({
			loading: true
		});

		singlePeople.forEach(p => {
			store.dispatch(ProfileActionCreator.register({
				name: p.name.first,
				gender: p.gender,
				interestedIn: p.gender === 'male' ? 'female' : 'male',
				type: 'single',
				birthday: this.getDOB(p.dob),
				location: p.location.city,
				nationality: p.nat,
				pictureThumbnail: p.picture.thumbnail,
				pictureMedium: p.picture.medium,
				pictureLarge: p.picture.large

			}));
		});

		friends.forEach(p => {
			store.dispatch(ProfileActionCreator.register({
				name: p.name.first,
				gender: p.gender,
				interestedIn: p.gender === 'male' ? 'female' : 'male',
				type: 'friend',
				birthday: this.getDOB(p.dob),
				location: p.location.city,
				nationality: p.nat,
				pictureThumbnail: p.picture.thumbnail,
				pictureMedium: p.picture.medium,
				pictureLarge: p.picture.large

			}))
		});

		this.setState({
			finished: true
		});
	}

	createRelations() {
		let friendIndex = 0;

		this.state.singleProfiles.forEach(p => {
			const numberFriends = Math.floor((Math.random() * 5) + 1);
			for (let i = 0; i < numberFriends; i++) {
				store.dispatch(ProfileActionCreator.linkFriend(p.id, this.state.friends[friendIndex + i].id));
			}
			friendIndex += numberFriends;
		});
	}

	getDOB(dob) {
		return dob.substr(0,10);
	}
}



const mapStateToProps = (state) => {
	return {
		profiles: state.profile.profiles
	};
};

export default connect(mapStateToProps)(DefaultDataCreator);





